  const [companies, setCompanies] = useState([]);

  return (
    <Col className="d-flex justify-content-center pt-5">
      <Row
        noGutters
        className="page-header py-4 px-4 bg-white card landing-cont"
      >
        <h2 className="mb-4">
          Welcome!
        </h2>
        <h4 className="mb-4 text-left">Select Company:</h4>
        <Row>
            <Col className="d-flex flex-column justify-content-center align-items-center col-lg 6 col-md-6 col-sm-12">
              {/* <Link to="#"> */}
                <Button
                  pill
                  className="btn-custom bg-custom my-2 card"
                  style={{
                    textAlign: "center",
                    fontWeight: "500",
                    fontSize: "1.2rem",
                    color: "#52b5e9",
                    width: "200px",
                    height: "200px",
                  }}
                >
                  Company 1
                </Button>
              {/* </Link> */}
            </Col>
        </Row>
      </Row>
    </Col>
  );
}
